import React from "react";
import Card from "./Card";
import contacts from "./contacts";

function App() 

{
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      
      
      
      {
      contacts.map((contact, index) => // This was very confusing to do and seems like a very backwards way of acheiving this. This could have easily been done with some type of templating engine.
      
      <Card
      name={contacts.name}
      img={contacts.imgURL}
      tel={contacts.phone}
      email={contacts.email}
    />


      )
      
    }

    
    
    </div>
  );
}


export default App;
